import Vue from "vue";
import Router from "vue-router";
import userRouter from "@/router/users";
//import prestataireRouter from "@/router/prestataires";

Vue.use(Router);

export default new Router({
    mode: "history",
    base: process.env.BASE_URL,
    routes:[userRouter]
})
